import React from 'react';
import { Icon } from 'semantic-ui-react'
class Assets extends React.Component{
	constructor(props){
		super(props)

    }
render(){
    return(
    <div>
        <div className="assetbar">
            <li>  Discovery    </li>
            <li>  List  </li>
            <li>  Map  </li>
        </div>
    
    <style jsx>{`
    .assetbar {
        display: flex;
        flex-direction: row;
        justify-content: flex-start;
      align-items: center;
        background: white;
        min-width: 160px;
        box-shadow: 0px 8px 16px 0px rgba(0,0,0,0.2);
        z-index: 1;
        position:absolute;
        width:108%;
      }
    
    `}</style>
    
    
    </div>
    );

}
}
export default Assets;
